import { CARD } from "./CaseStudyCardInfo/caseConstants";
import CaseStudyCard from "./CaseStudyCardInfo/CaseStudyCard";

export default function CaseStudy() {
    return (
        <div className="pb-5">
            <div className="text-white pl-5 pt-5 text-xs">
                <h6>/Case Studies</h6>
            </div>
            <div className="flex flex-col justify-center items-center w-1/2 h-1/2 mx-auto">
                <div className="grid grid-cols-3 gap-4 overflow-scroll">
                    {CARD.map((card) => (
                        <CaseStudyCard
                            key={card.key}
                            image={card.img}
                            header={card.header}
                            alt={card.alt}
                        />
                    ))}
                </div>
            </div>
            <div className="flex justify-center pt-5">
                <button className="text-white bg-black border border-solid border-blue-500 text-base px-4 py-2 rounded-lg">
                    Our Portfolio
                </button>
            </div>
        </div>
    )
};
